import React from 'react';
import PropTypes from 'prop-types';
import {
  PokemonCard,
  PokemonCardContent,
  PokemonCardFooter,
  PokemonCardMedia,
  PokemonCardBody,
  // ButtonInfo,
  Typographys,
} from './MaterialCardStyle';
import Grid from '@material-ui/core/Grid';

const MaterialCard = ({
    pokemons,
}) => (
  <Grid container>
    {/* {
      pokemons.map(item => (
        item.pokemon.map(pokemon => (
          <Grid item xs={3} key={pokemon.id}>
            <PokemonCard>
                <PokemonCardContent>
    
                <PokemonCardMedia
                  image={pokemon.sprites.front_shiny}
                />

                <PokemonCardBody>
                  <Typographys gutterBottom variant="h5" component="h2">
                    {pokemon.name}
                  </Typographys>
                </PokemonCardBody>
              </PokemonCardContent>
              <PokemonCardFooter />
            </PokemonCard>
          </Grid>
        ))
      )) 
    } */}
    {pokemons.map(item => item.pokemon.map(pokemon => console.log(pokemon.sprites.front_shiny)))}
  </Grid>
);

MaterialCard.propTypes = {
  pokemons: PropTypes.array,
}

export default MaterialCard;
